function decodeInstr(loc) {
    var word = this.mem[loc];
    var type = word >> 13;
    switch (type) {
        case 0: return this.decodeJMPINC(loc, word);
        case 1: return this.decodeMRI(loc, word);
        case 2: return this.decodeMRI(loc, word);
        case 3: return this.decodeIO(loc, word);
        case 4: return this.decodeALU(loc, word);
        case 5: return this.decodeALU(loc, word);
