422.source:
function decodeALU(loc, word) {
    var src = word>>13 & 3;
    var dest = word>>11 & 3;
    var func = word>>8 & 7;
    var shiftCtl = word>>6 & 3;
    var carryCtl = word>>4 & 3;
    var noload = word>>3 & 1;
    var skipCtl = word & 7;
    instr = ['COM', 'NEG', 'MOV', 'INC', 'ADC', 'SUB', 'ADD', 'AND'][func];
    instr += ['', 'Z', '0', 'C'][carryCtl];
    instr += ['', 'L', 'R', 'S'][shiftCtl] + [' ', 'N '][noload];
    instr += src.toString() + ',' + dest.toString();
    instr += ['    ', ',SKP', ',SZC', ',SNC', ',SZR', ',SNR', ',SEZ', ',SBN'][skipCtl]
    return instr;
    //return instr + "\n" + word.toString(2); // print binary instr
}

