function scanForCode(a) {
    // this.scanForCode(['LDA 3,@.-122']) ==> 3733,4007,66007,100603
    // scan this.mem for a sequence of instructions
    // Note: the instrs must be given exactly as they would disassemble
    // return an array of octal-printed locations of any matches
    if (!(a instanceof Array)) return 'arg must be an Array'
    var found = [];
    for (var i=0; i<(this.mem.length-a.length); i++) {
        var find = true;
        for (var j=0; j<a.length; j++) {
            if (this.decodeInstr(this.mem[i+j]) != a[j]) find = false;
            }
        if (find) found.push(i.toString(8));
    }
    return found.length==0 ? 'none found' : found;
}

