440.source:
function decodeIO(loc, word) {
    if ((word & 0177400) == 064400)  { //JSRII
        var disp = word & 255;
        var sDisp = disp >= 128 ? disp - 256 : disp;
        var instr = "JSRII " +  (sDisp < 0 ? '.'+sDisp.toString(8) : '.+'+sDisp.toString(8));
        return instr + this.decodeEffAddr(loc, 1, disp, 1, 1);
    }
    if (word == 061001) return "EIR";
    if (word == 061020) return "MUL";
    if (word == 061021) return "DIV";
    if (word == 067000) return "CONVERT";
    if (word == 061005) return "BLT";
    if (word == 061006) return "BLKS";
    return "UNKNOWN"
}

443.source:
function decodeJMPINC(loc, word) {
    var op = word>>11 & 3;
    var ind = word>>10 & 1;
    var ix = word>>8 & 3;
    var disp = word & 255;
    var sDisp = disp >= 128 ? disp - 256 : disp;
    instr = ['JMP ', 'JSR ', 'ISZ ', 'DSZ '][op] + ['', '@'][ind];
    if (sDisp < 0)
        instr += [disp.toString(8), '.'+sDisp.toString(8), sDisp.toString(8)+',2', sDisp.toString(8)+',3'][ix];
    else
        instr += [disp.toString(8), '.+'+sDisp.toString(8), sDisp.toString(8)+',2', sDisp.toString(8)+',3'][ix];
    return instr + this.decodeEffAddr(loc, ix, disp, ind, 0);
}

446.source:
function decodeMRI(loc, word) {
    var type = word>>13 & 3;
    var ac = word>>11 & 3
    var ind = word>>10 & 1;
    var ix = word>>8 & 3;
    var disp = word & 255;
    var sDisp = disp >= 128 ? disp - 256 : disp;
    instr = ['LDA ', 'STA '][type-1] + ac + [',', ',@'][ind];
    if (sDisp < 0)
        instr += [disp.toString(8), '.'+sDisp.toString(8), sDisp.toString(8)+',2', disp.toString(8)+',3'][ix];
    else
        instr += [disp.toString(8), '.+'+sDisp.toString(8), sDisp.toString(8)+',2', sDisp.toString(8)+',3'][ix];
    return instr + this.decodeEffAddr(loc, ix, disp, ind, 0);
}

449.source:
function execALU(word) {
    var src = word>>13 & 3;
    var dst = word>>11 & 3;
    var func = word>>8 & 7;
    var shift = word>>6 & 3;
    var carryCtl = word>>4 & 3;
    var noload = word>>3 & 1;
    var skipCtl = word & 7;
    var source = this.getReg(src);
    var dest = this.getReg(dst);
    var alu, carry, doSkip;
    ;
    switch(carryCtl) {
    case 0: {carry = this.CRY; break} // carry unchanged
    case 1: {carry = 0; break} // Z set carry to zero
    case 2: {carry = 1; break} // O set carry to one
    case 3: {carry = this.CRY ^ 1; break} // C comp the carry
    }
    switch(func) {
    case 0: {alu = source ^ 0xFFFF; break}      // COM
    case 1: {alu = (source ^ 0xFFFF) + 1;       // NEG
            if (source == 0) carry ^= 1; break}
    case 2: {alu = source; break}               // MOV
    case 3: {alu = source + 1;                  // INC
            if (source == 0xFFFF) carry ^= 1; break}
    case 4: {alu = dest + (source ^ 0xFFFF);    // ADC
            if (source < dest) carry ^= 1; break}
    case 5: {alu = dest + (-source & 0xFFFF);   // SUB
            if (source <= dest) carry ^= 1; break}
    case 6: {alu = dest+source;                 // ADD
            if (alu > 0xFFFF) carry ^= 1; break}
    case 7: {alu = dest & source; break}        // AND
    }
    alu &= 0xFFFF;
    switch(shift) {
    case 0: {break}                     // no shift
    case 1: {var nc = alu >> 15;        // left shift
            alu = (alu<<1) + carry;
            carry = nc; break}
    case 2: {var nc = alu & 1;          // right shift
            alu = (alu>>1) + (carry<<15);
            carry = nc; break}
    case 3: {var left = alu & 0xFF00;   // swap bytes
            var right = alu & 0x00FF;
            alu = (left>>8) + (right<<8); break}
    }
    if (noload==0) {
        this.setReg(dst, alu);
        this.CRY = carry;
    }
    switch(skipCtl) {
    case 0: {doSkip = false; break} // no skip
    case 1: {doSkip = true; break} // SKP
    case 2: {doSkip = carry==0; break} // SZC
    case 3: {doSkip = carry==1; break} // SNC
    case 4: {doSkip = alu==0; break} // SZR
    case 5: {doSkip = alu!=0; break} // SNR
    case 6: {doSkip = carry==0 || alu==0; break} // SEZ
    case 7: {doSkip = carry!=0 && alu!=0; break} // SBN
    }
    if (doSkip) return this.PC + 2;
        else return this.PC + 1;  // next instruction address
}

452.source:
function execInstr(instr) {
    var type = instr >> 13;
    switch (type) {
        case 0: return this.execJMPINC(instr);
        case 1: return this.execMRI(instr);
        case 2: return this.execMRI(instr);
        case 3: return this.execIO(instr);
        case 4: return this.execALU(instr);
        case 5: return this.execALU(instr);
        case 6: return this.execALU(instr);
        case 7: return this.execALU(instr);
    }
}

455.source:
function execIO(word) {
    if ((word & 0177400) == 064400)  {  // JSRII
        var disp = word & 255;
        var addr = this.effAddr(disp, 1, 1);  // indirect, pc-rel
        addr = this.mem[addr];  // double indirect
        this.AC3 = this.PC+1;  // rest is like JSR
        return addr;
    }
    if (word == 061020) {  // MUL
        result = this.AC1*this.AC2 + this.AC0;
        this.AC1 = result & 0xFFFF;
        this.AC0 = (result >> 16)  & 0xFFFF;
        return this.PC + 1;
    }
    if (word == 061021) {  // DIV
        var dbl = (this.AC0 * 0x10000) + this.AC1;
        var divisor = this.AC2;
        if (this.AC0 >= this.AC2) { debugger;  return this.PC + 1 }
        var quot = Math.floor(dbl/divisor);  // quotient
        var rem = dbl - quot*divisor;  // remainder
        this.AC1 = quot;
        this.AC0 = rem;
        return this.PC + 2;
    }
    if (word == 061005) {  // BLT
        var sAddr = this.AC0+1;
        var negCnt = (this.AC3>=32768) ? this.AC3-65536 : this.AC3;
        var addr = this.AC1 + negCnt + 1;
        for (var i=negCnt; i<0; i++) {
            this.mem[addr] = this.mem[sAddr];
            addr++;
            sAddr++; }
        this.AC0 = sAddr;
        return this.PC + 1;
    }
    if (word == 061006) {  // BLKS
        var negCnt = (this.AC3>=32768) ? this.AC3-65536 : this.AC3;
        var addr = this.AC1 + negCnt + 1;
        for (var i=negCnt; i<0; i++) {
            this.mem[addr] = this.AC0;
            addr++; }
        return this.PC + 1;
    }
    if ((word & 0177400) == 060000)  {  // CYCLE
        var shiftCount = word & 0xF;
        if (shiftCount == 0) shiftCount = this.AC1 & 0xF;
        this.AC0 = 0xFFFF & ((this.AC0<<shiftCount) | (this.AC0>>(16-shiftCount)));
        return this.PC + 1;
    }
    if ((word & 0177400) == 067000) {  // CONVERT
        var charBlockAddr = this.AC3 + this.mem[this.AC3]; //self-rel ptr
        var disp = word & 255;
        disp = disp >= 128 ? disp - 256 : disp;  // sign-extended disp
        var cTableAddr = this.AC2 + disp;
        var nwrds = this.mem[cTableAddr];  // scan line width
        var dba = this.mem[cTableAddr+1];  // destination bit address
        var destWordAddr = this.AC0 + nwrds;
        var charWidth = this.mem[charBlockAddr] >> 1;
        var hd = this.mem[charBlockAddr+1] >> 8;  // vertical delta
        var xh = this.mem[charBlockAddr+1] & 255;  // height of bits
        destWordAddr += nwrds*hd;
        charBlockAddr -= xh;
        // Now OR the bits into the two adjacent words of destination
        for (var i=0; i<xh; i++) {
            this.mem[destWordAddr] |= this.mem[charBlockAddr] >> (15-dba);
            this.mem[destWordAddr+1] |= (this.mem[charBlockAddr] << (dba+1)) & 0xFFFF;
            destWordAddr += nwrds;
            charBlockAddr += 1;
        }
        this.AC1 = dba & 15;
        this.AC3 = charWidth;
        return this.PC + 2;  // skip-return for no extensions
    }
    if (word == 061001) return this.PC + 1;  // EIR ignored

    this.stop();  // uniplemented instruction
    debugger;
    return this.PC;  // this instruction
}

458.source:
function execJMPINC(word) {
    // LDA and STA
    var op = word>>11 & 3;
    var ind = word>>10 & 1;
    var ix = word>>8 & 3;
    var disp = word & 255;
    var addr = this.effAddr(disp, ix, ind)
    switch (op) { 
        case 0: {return addr}  // JMP (we return the next instr addr)
        case 1: {this.AC3 = this.PC+1;  return addr}    // JSR
        case 2: {var x = (this.mem[addr]+1) & 0xFFFF;   // ISZ
                this.mem[addr] = x;
                return x==0 ? this.PC+2 : this.PC+1}
        case 3: {var x = (this.mem[addr]-1) & 0xFFFF;   // DSZ
                this.mem[addr] = x;
                return x==0 ? this.PC+2 : this.PC+1}
    }
}

461.source:
function execMRI(word) {
    // LDA and STA
    var type = word>>13 & 3;
    var ac = word>>11 & 3
    var ind = word>>10 & 1;
    var ix = word>>8 & 3;
    var disp = word & 255;
    var addr = this.effAddr(disp, ix, ind)
    if (type == 1) this.setReg(ac, this.mem[addr]);   // LDA
    if (type == 2) this.mem[addr] = this.getReg(ac);  // STA
    return this.PC + 1;  // next instruction address
}

464.source:
function step() {  // this.step()
    // This is the morphic step, which may execute many instructions
    // For nova single step, use singleStep()
    var n = 40000;  // instructions per tick
    var t1 = new Date().getTime();
    var i1 = this.instructionCount;
    if (this.showingST) {
        for (var i=0; i<n; i++) {
            var instr = this.mem[this.PC];
            var oldPC = this.PC;
            this.PC = this.execInstr(instr); // each returns next address
            this.instructionCount++;
            }
        this.displayMorph.renderScreen(); 
    } else {
        var instr = this.mem[this.PC];
        this.PC = this.execInstr(instr); // each returns next address
        this.instructionCount++;
        //if (this.instructionCount == 8400) this.stop();
        this.showPC(this.PC);  // only in trace mode
        this.showRegs();
    }
    var t2 = new Date().getTime();
    var i2 = this.instructionCount;
    ips = ((i2-i1) / Math.max(1, t2-t1))*1000; // instrs per sec
    this.ips = (this.ips || 0)*0.9 + ips * 0.1;
    return; 
}

