function restart() {  // this.restart()
    this.memBase = -999;  // will force a new display of memory
    // this.mem = this.bkupMem.slice();  
    // make a clean copy of small.sv in a Uint16Array
    this.mem = new Uint16Array(this.bkupMem.length);  
    for (var i=0; i<this.mem.length; i++) this.mem[i] = this.bkupMem[i];

    this.vmemStateLoc = 076;
    this.memBits = 030342;
    this.smallIntSpec = {minOop: 04012, maxOop: 05013, smallInt1: 0402, sclass: 05260};
    this.classOops = {'Class': 05210, 'Number': 05260, 'Vector': 05350, 'Atom': 05430, 'String': 05470, 'Arec': 05540, 'Float': 05610};
    this.mxAtom = 03777;

    // initial values for pc, instr, ACs and carry
    var init = ['213C','8200','0001','0000','38E4','213C','0'].map(
        function(s) {return parseInt(s, 16)});
    this.PC = init[0];
    for (var i=0; i<5; i++) {
        this[['AC0', 'AC1', 'AC2', 'AC3', 'CRY'][i]] = init[i+2];
    }
    this.instructionCount = 0;
    this.showPC(this.PC);
    // this.showCurrent();
}

