    this.syms[07747] = 'ERET';
    this.syms[07716] = 'EMODE';
    this.syms[07704] = 'ARET';
    this.syms[07667] = 'EVAL';
    this.syms[020466] = 'INOUT';
    this.syms[01443] = 'RFALSE';
    this.syms[023756] = 'MATCHTOKEN';
    this.syms[02355] = 'PEEK';
    this.syms[05417] = 'SVAL';
    this.syms[02355] = 'PEEK';
    this.syms[023623] = 'LOAD';
    this.syms[010112] = 'ACTIV';
    this.syms[0100] = 'CURRENT';
    this.syms.RKB = 026105;
    this.syms.KBPW = 026134;  // keyboard Q write ptr
    this.syms.KBQ = 026136;  // indir ptr to KB Q
    this.syms.KBMODP = 026135;  // Q size
    this.syms.KBPR = 026133;  // Q read ptr
    this.syms.ATRAP = 026050;  // loc of eval trap
    this.syms.EVAL = 07667;  // loc of eval

    this.syms[026135] = 'KBMODP';  // QUEUE size
    this.syms[026135] = 'KBMODP';  // QUEUE size
    return this.syms

    var pops = {}; // pseudoOps used in ST-72 intepreter
    pops['INCN 0,0,SZR'] = 'SNL 0,0';  // skip if nil (-1)
    pops['SUBN 0,1,SNR'] = 'SNE 0,1';  // skip if not equal
    pops['INCN 0,0,SZR'] = 'SNL';  // skip if nil
    pops['ADC 0,0'] = 'NIL 0,0';  // make a nil (-1)
    pops['MOV 0,0'] = 'NOP';
    pops['LDA 0,@52'] = 'LDAF MODE';
    pops['STA 0,@52'] = 'STAF MODE';
}

