494.source:
function loadObject(oop) {
    // JSON.stringify(this.loadObject(023342))
    var classes = this.classOops;
    var vmem = this.vmemState();

    if (oop == 0177777) // this isn't quite right
        return {sclass: classes.Atom, value: 'nil'};

    //Check for atoms...
    if (oop <= vmem.mxAtom) {
        var str = this.loadField(oop, 0);
        var spec = this.loadObject(str);
        return {sclass: classes.Atom, value: spec.value};
    }
    //Check for small integers...
    if (oop <= vmem.maxSmallInt && oop >= vmem.minSmallInt) 
        return {sclass: classes.Number, value: oop-vmem.smallInt0};

    //Check for activations...
    if (oop >= vmem.bhmem) {
        var arec = this.loadArec(oop);
        return {sclass: classes.Arec, fields: arec};
    }

    var sclass = this.loadField(oop, 0) & vmem.noRefctMask;

    if (sclass == classes.Number)
        return {sclass: sclass, value: this.loadField(oop, 1)};

    if (sclass == classes.String)
        return {sclass: sclass, value: this.loadStringData(oop)};

    if (sclass == classes.Vector) {
        var sz = this.loadField(oop, 1);
        console.log("sz = " + sz );
        if (sz > 1000) debugger;
        var data = range(2, sz+1).map(function (i) {
            var token = this.loadField(oop, i);
            console.log("sz, i, token = " + sz + ", " + i + ", " + 
                (token == 0177777 ? 'nil': token.toString(8)));
            return token}, this)
        return {sclass: sclass, value: data};
    }
    if (sclass == classes.Class) {
        var name = this.lookupOopInClass(0513, oop);
        return {sclass: sclass, name: name};
    }
    var name = this.printObject(this.lookupOopInClass(0513, sclass), 'dontRecur');
    return {sclass: sclass, name: "a-"+name};
}

500.source:
function scanForString(s) {
    // this.scanForString('vector')10376,35616,none
    // scan this.mem for a sequence of characters
    // return an array of octal-printed locations of any matches
    if (s.length < 3) return 'string must be at least 3 characters long'
    var a = [];  // This finds ST strings with length in first word...
    nWords = Math.floor(s.length/2);
    for (var i=0; i<nWords; i++) {
        var left = s.charCodeAt(i*2);
        var right = s.charCodeAt((i*2)+1);
        a[i] = (left*256) + right;
    }
    var b = [];  // This finds assembled string with length in first byte
    nWords = Math.floor((s.length-1)/2);
    for (var i=0; i<nWords; i++) {
        var left = s.charCodeAt((i*2)+1);
        var right = s.charCodeAt((i*2)+2);
        b[i] = (left*256) + right;
    }
    return this.scanForValues(a).concat(this.scanForValues(b))
}

503.source:
function loadStringData(oop) {
    // this.loadStringData(05756)
    var addr = this.memBits + oop;
    var size = this.mem[addr+1];
    var str = "";
    for (var i=0; i<size; i++) {
        var word = this.mem[addr+2 + Math.floor(i/2)];
        if (i%2 == 0) str += String.fromCharCode(word>>8);
        else str += String.fromCharCode(word&255)
    }
    return str;
}

506.source:
function printObject(oop, dontRecur) {
    // this.printObject(0177777)
    // this.printObject(023342)(SELF set to write 256 0 . SELF reset . dirinst close . 9 CODE 50 nil )
    // JSON.stringify(this.loadObject(023342)){"sclass":2792,"value":[521,770,576,1788,2442,2186,1720,521,816,1720,1065,1214,1720,2195,1458,2236,65535]}

    var classes = this.classOops;
    var obj = this.loadObject(oop);
    //console.log("oop, obj = " + oop.toString(8) + JSON.stringify(obj));
    if (obj.sclass == classes.Number) return obj.value.toString();
    if (obj.sclass == classes.Atom) return obj.value;
    if (obj.sclass == classes.String) return "'" + obj.value + "'";
    if (obj.sclass == classes.Class) 
        return this.loadObject(obj.name).value;
    if (obj.sclass == classes.Arec) 
        return "Activation of " + this.printObject(obj.fields.sclass, 'dontRecur');
    if (obj.sclass == classes.Vector) {
        if (dontRecur) return "()";
        var str = "(";
        obj.value.forEach (function (ea) {
            str += this.printObject(ea, 'dontRecur') + " "}, this);
        return str +")";
    }
    return obj.name;
}

509.source:
function lookupOopInClass(oop, clas) {
    // this.lookupOopInClass(0513, 05210)
    var sclass = this.loadField(clas, 0) & this.vmemState().noRefctMask;
    if (sclass != this.classOops.Class) return 'not a class';

     // scan the class dict
    var size = this.loadField(clas, 1) + 1;
    var value = null;
    range(1, size).forEach(function (i) {
        // mask off descriptor bits
        var key = (this.loadField(clas, 4 + 2*(i-1))) & 07777;
        if (key == oop) value = this.loadField(clas, 4 + 2*(i-1) + 1)
        }, this)
    return value;
}

