518.source:
function printArecCodeWithPC(oop) { 
    // this.printArecCodeWithPC(this.vmemState().current)
    if (oop == 0177777) return 'nil';
    var arec = this.loadArec(oop);

    // work back from pc to find the current code vector ;-)
    var code = arec.pc;
    while ((this.loadField(code, 0) & this.vmemState().noRefctMask) != this.classOops.Vector) code = code-1;

    var codeStr = '';
    var size = this.loadField(code, 1);
    for (var i=2; i<=size+1; i++) {
        var token = this.loadField(code, i)
        if (i == arec.pc - code) codeStr += "-->";
        codeStr += this.printObject(token, 'dontRecur') + " ";
    }
    return this.printObject(oop) +  "\ncode: " + codeStr;
}

