530.source:
function effAddr(disp, ix, ind) {
    // compute the effective address for MRI instructions
    var sDisp = disp >= 128 ? disp - 256 : disp;  // sign-extended disp
    switch(ix) { 
        case 0: { var addr = disp; break };  Page0
        case 1: { var addr = sDisp + this.PC; break };  PC-rel
        case 2: { var addr = sDisp + this.AC2; break };  AC2-rel
        case 3: { var addr = sDisp + this.AC3; break };  AC3-rel
    }
    if (ind == 0) return addr;
        else return this.mem[addr];  // indirect access
}

533.source:
function decodeEffAddr(loc, ix, disp, ind, ii) {
    // Return a string describing the effective address for listing
    if (ix >= 2) return '';
    if (ix == 0) var addr = disp
    else { var sDisp = disp >= 128 ? disp - 256 : disp;
        var addr = loc + sDisp; }
    if (ind > 0) addr = this.mem[addr];  // indirect
    if (ii > 0) addr = this.mem[addr];  // double indirect
    var str = "; 0" + addr.toString(8);
    if (this.syms[addr]) str += " =" + this.syms[addr];
    return str;
}

