539.source:
function putKB(charCode) {  // this.putKB(48)
    // enter an ascii character into the ST-72 keyboard queue
    // note this duplicates the interrupt code at #RKB
	console.log("charCode = " + charCode);
	if (charCode==27) { // Hitting ESC puts a trap at EVAL
	    this.mem[this.syms.EVAL] = this.mem[this.syms.ATRAP];
	    return
	}
	var PW = this.mem[this.syms.KBPW];  // write pointer
	var nextPW = PW + 1;
	var MODP = this.mem[this.syms.KBMODP];  // queue size
	if (nextPW >= MODP) nextPW -= MODP;
	var PR = this.mem[this.syms.KBPR];  // read pointer
	if (nextPW == PR) return false;  // FWIW; queue is full
	this.mem[this.syms.KBPW] = nextPW;  // update the write pointer
	var Qbase = this.mem[this.mem[this.syms.KBQ]];
    // console.log("[stChar, pw, modp, pr, Qbase] = " + [stChar, pw, modp, pr, Qbase]);
    this.mem[Qbase + PW] = charCode;  // store the character
	return;
}

