function toggleST() { // this.toggleST()
    // If this.showingST = false, this shows the display and runs ST-72
    if (!this.showingST) {
        this.addMorph(this.displayMorph);
        this.showingST = true;
        this.displayMorph.reset();
        this.displayMorph.renderScreen();
        this.displayMorph.focus();
        this.run();
    }
    // If already true, it hides the display and turns off ticking
    else {
        this.displayMorph.remove();
        this.showingST = false;
        this.stopStepping()
    }
    this.get('ToggleButton').setLabel(this.showingST ? 'Show Nova' : 'Show Smalltalk');
}

